import {useState} from "react";

function Imc() {
    const [peso, setPeso] = useState();
    const [altura, setAltura] = useState();


    return (
        <form>
        <label>Peso</label>
        <input onChange={(e) => {
            setPeso(e.target.value);
        }}/>
        <br/>
        <label>Altura</label>
        <input onChange={(e) => {
            setAltura(e.target.value);
        }}/>
        <br/>
        <input type='submit'/>
    </form>

    )
    
}

export default Imc;
